function Diagnose(){

    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch('/symptoms').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )  
    }, [])

    return (
        <div>
            <h1>Diagnosis results</h1>
            {data}
            {/* {data.symptoms} */}
            {/* {(typeof {data} === 'undefined') ? (
                <p>Loading...</p>
            ) : (
                {data}
            )

            } */}
        </div>
    );
}

export default Diagnose;
